const content = "\"---\\ntitle: Middleware\\n---\\n# Middleware\\n\\n用于拓展 Modern.js 内置的 Web Server，只有 SSR 请求会经过这些中间件。\\n\\n与 [Hook](/apis/app/runtime/web-server/hook) 不同的是，Middleware 可以使用 Server 运行时框架拓展。\\n\\n:::note\\n更多内容可以查看[自定义 Web Server](/guides/advanced-features/web-server)。\\n\\n:::\\n\\n## 使用姿势\\n\\n```ts\\nimport { Middleware } from '@modern-js/runtime/server';\\n\\nexport const middleware: Middleware = async (context, next) => {};\\nexport const middleware: Middleware[] = [\\n  async (context, next) => {},\\n  async (context, next) => {},\\n];\\n```\\n\\n:::info 自定义 Web Server\\n使用该 API 前，请先执行 `pnpm run new` 新建「自定义 Web Server」源码目录。\\n\\n```bash\\npnpm run new\\n? 请选择你想要的操作 创建工程元素\\n? 新建「自定义 Web Server」源码目录\\n```\\n\\n:::\\n\\n## 函数签名\\n\\n```ts\\ntype MiddlewareContext = {\\n  response: {\\n    set: (key: string, value: string) => void;\\n    status: (code: number) => void;\\n    cookies: {\\n      get: (key: string) => string;\\n      set: (key: string, value: string) => void;\\n      delete: () => void;\\n      clear: () => void;\\n      apply: () => void;\\n    };\\n    raw: (\\n      body: string,\\n      { status, headers }: { status: number; headers: Record<string, any> },\\n    ) => void;\\n    locals: Record<string, any>;\\n  };\\n  request: {\\n    url: string;\\n    host: string;\\n    pathname: string;\\n    query: Record<string, any>;\\n    cookie: string;\\n    cookies: {\\n      get: (key: string) => string;\\n    };\\n    headers: IncomingHttpHeaders;\\n  };\\n  source: {\\n    req: IncomingMessage;\\n    res: ServerResponse;\\n  };\\n};\\n\\ntype RequestHandler = (\\n  context: Context,\\n  next: NextFunction,\\n) => Promise<void> | void;\\n```\\n\\n### 参数\\n\\n- `context`：提供当前 Hook 上下文。\\n  - `response`：提供一系列处理响应的操作\\n  - `request`：提供一系列获取请求信息的操作\\n  - `source`：提供 Node.js 原生的 `req` 与 `res` 对象。\\n- `next`：执行当前 Hook 的下一个监听函数（不影响整体服务端流程）。\\n\\n## 示例\\n\\n### 服务端耗时打点\\n\\n```ts\\nexport const Middleware = () => async (ctx, next) => {\\n  const start = Date.now();\\n  ctx.res.once('finish', () => {\\n    console.log(Date.now() - start);\\n  });\\n};\\n```\\n\\n### 注入服务端工具 & 数据\\n\\nModern.js 提供了 `res.locals` 属性用来存放当前请求的局部变量。\\n\\n```ts\\nexport const Middleware = () => async (ctx, next) => {\\n  ctx.res.locals.id = 'Modern.js';\\n  ctx.res.locals.rpc = createRpcInstance();\\n});\\n```\\n\"";
